# Generated: 2025-12-21
# Total files: 274
# Original size: 2.11 MB

param(
    [Parameter(Mandatory=$true)]
    [string]$InstallPath,
    [switch]$Force
)

Set-StrictMode -Version Latest

Write-Host "PMC TUI Installer" -ForegroundColor Cyan
Write-Host "================" -ForegroundColor Cyan
Write-Host ""

# Check if path exists
if (Test-Path $InstallPath) {
    if (-not $Force) {
        Write-Host "ERROR: Install path already exists: $InstallPath" -ForegroundColor Red
        Write-Host "Use -Force to overwrite" -ForegroundColor Yellow
        exit 1
    }
    Write-Host "Removing existing installation..." -ForegroundColor Yellow
    Remove-Item -Path $InstallPath -Recurse -Force
}

# Create base directory
New-Item -ItemType Directory -Path $InstallPath -Force | Out-Null

# Helper function to decompress and write file
function Install-File {
    param([string]$RelPath, [string]$Data)
    
    $fullPath = Join-Path $InstallPath $RelPath
    $dir = Split-Path $fullPath -Parent
    
    if (-not (Test-Path $dir)) {
        New-Item -ItemType Directory -Path $dir -Force | Out-Null
    }
    
    # Decode and decompress
    $bytes = [System.Convert]::FromBase64String($Data)
    $ms = [System.IO.MemoryStream]::new($bytes)
    $gs = [System.IO.Compression.GzipStream]::new($ms, [System.IO.Compression.CompressionMode]::Decompress)
    $sr = [System.IO.StreamReader]::new($gs)
    
    # For binary files, we need different handling
    try {
        $ms2 = [System.IO.MemoryStream]::new()
        $gs.CopyTo($ms2)
        $content = $ms2.ToArray()
        [System.IO.File]::WriteAllBytes($fullPath, $content)
    }
    finally {
        if ($sr) { $sr.Dispose() }
        if ($gs) { $gs.Dispose() }
        if ($ms) { $ms.Dispose() }
        if ($ms2) { $ms2.Dispose() }
    }
}

