$count = 0
$total = $files.Count

foreach ($file in $files.GetEnumerator()) {
    $count++
    $pct = [Math]::Floor(($count / $total) * 100)
    Write-Progress -Activity "Installing PMC TUI" -Status "$pct% - $($file.Key)" -PercentComplete $pct
    Install-File -RelPath $file.Key -Data $file.Value
}

Write-Progress -Activity "Installing PMC TUI" -Completed

# Create start script
$startScript = @"
# PMC TUI Launcher
Set-Location "`$PSScriptRoot"
. "./module/Pmc.Strict/consoleui/Start-PmcTUI.ps1"
Start-PmcTUI
"@
Set-Content -Path (Join-Path $InstallPath "start.ps1") -Value $startScript

